contracts/GameRewards.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract GameRewards is Ownable, ReentrancyGuard {
    struct Mission {
        uint256 id;
        string name;
        string description;
        uint256 reward;
        uint256 difficulty;
        uint256 duration;
        bool active;
    }

    struct UserMission {
        uint256 missionId;
        uint256 progress;
        uint256 startTime;
        bool completed;
        bool claimed;
    }

    struct LeaderboardEntry {
        address user;
        uint256 score;
        uint256 timestamp;
    }

    IERC20 public rewardToken;

    mapping(uint256 => Mission) public missions;
    mapping(address => mapping(uint256 => UserMission)) public userMissions;
    mapping(address => uint256) public userPoints;
    mapping(address => uint256) public userLevel;
    mapping(address => uint256) public dailyStreak;
    mapping(address => uint256) public lastActivity;
    mapping(address => bool) public socialBonus;

    LeaderboardEntry[] public leaderboard;
    uint256 public missionCounter;
    uint256 public constant POINTS_PER_LEVEL = 1000;
    uint256 public constant DAILY_STREAK_BONUS = 50;
    uint256 public constant SOCIAL_BONUS_MULTIPLIER = 120;

    event MissionCreated(uint256 indexed missionId, string name, uint256 reward);
    event MissionStarted(address indexed user, uint256 indexed missionId);
    event MissionCompleted(address indexed user, uint256 indexed missionId, uint256 reward);
    event LevelUp(address indexed user, uint256 newLevel);
    event StreakBonus(address indexed user, uint256 streak, uint256 bonus);
    event SocialBonusActivated(address indexed user);

    modifier validMission(uint256 _missionId) {
        require(_missionId > 0 && _missionId <= missionCounter, "Invalid mission ID");
        require(missions[_missionId].active, "Mission not active");
        _;
    }

    constructor(address _rewardToken) Ownable(msg.sender) {
        rewardToken = IERC20(_rewardToken);
        _initializeMissions();
    }

    function _initializeMissions() internal {
        createMission(
            "First Deposit",
            "Make your first USDT deposit",
            100,
            1,
            86400
        );

        createMission(
            "Yield Explorer",
            "Try 3 different yield strategies",
            250,
            2,
            604800
        );

        createMission(
            "Social Trader",
            "Share a strategy with 5 LINE friends",
            200,
            2,
            259200
        );

        createMission(
            "Risk Manager",
            "Set your risk tolerance profile",
            75,
            1,
            3600
        );

        createMission(
            "Yield Master",
            "Earn 100 USDT in yield rewards",
            500,
            3,
            2592000
        );
    }

    function createMission(
        string memory _name,
        string memory _description,
        uint256 _reward,
        uint256 _difficulty,
        uint256 _duration
    ) public onlyOwner {
        missionCounter++;
        missions[missionCounter] = Mission({
            id: missionCounter,
            name: _name,
            description: _description,
            reward: _reward,
            difficulty: _difficulty,
            duration: _duration,
            active: true
        });

        emit MissionCreated(missionCounter, _name, _reward);
    }

    function startMission(uint256 _missionId) external validMission(_missionId) {
        require(userMissions[msg.sender][_missionId].startTime == 0, "Mission already started");

        userMissions[msg.sender][_missionId] = UserMission({
            missionId: _missionId,
            progress: 0,
            startTime: block.timestamp,
            completed: false,
            claimed: false
        });

        emit MissionStarted(msg.sender, _missionId);
    }

    function updateMissionProgress(address _user, uint256 _missionId, uint256 _progress) 
        external 
        onlyOwner 
        validMission(_missionId) 
    {
        UserMission storage userMission = userMissions[_user][_missionId];
        require(userMission.startTime > 0, "Mission not started");
        require(!userMission.completed, "Mission already completed");

        Mission memory mission = missions[_missionId];
        require(block.timestamp <= userMission.startTime + mission.duration, "Mission expired");

        userMission.progress = _progress;

        if (_progress >= 100) {
            userMission.completed = true;
            _updateDailyStreak(_user);
            emit MissionCompleted(_user, _missionId, mission.reward);
        }
    }

    function claimMissionReward(uint256 _missionId) external nonReentrant {
        UserMission storage userMission = userMissions[msg.sender][_missionId];
        require(userMission.completed, "Mission not completed");
        require(!userMission.claimed, "Reward already claimed");

        Mission memory mission = missions[_missionId];
        uint256 baseReward = mission.reward;
        uint256 levelBonus = (userLevel[msg.sender] * baseReward) / 100;
        uint256 streakBonus = (dailyStreak[msg.sender] * DAILY_STREAK_BONUS);

        uint256 totalReward = baseReward + levelBonus + streakBonus;

        if (socialBonus[msg.sender]) {
            totalReward = (totalReward * SOCIAL_BONUS_MULTIPLIER) / 100;
        }

        userMission.claimed = true;
        userPoints[msg.sender] += totalReward;

        _checkLevelUp(msg.sender);
        _updateLeaderboard(msg.sender);

        rewardToken.transfer(msg.sender, totalReward);
    }

    function _updateDailyStreak(address _user) internal {
        uint256 lastActivityTime = lastActivity[_user];
        uint256 timeDiff = block.timestamp - lastActivityTime;

        if (timeDiff <= 86400) {
            dailyStreak[_user]++;
        } else if (timeDiff > 172800) {
            dailyStreak[_user] = 1;
        }

        lastActivity[_user] = block.timestamp;

        if (dailyStreak[_user] % 7 == 0) {
            uint256 bonus = dailyStreak[_user] * DAILY_STREAK_BONUS;
            userPoints[_user] += bonus;
            emit StreakBonus(_user, dailyStreak[_user], bonus);
        }
    }

    function _checkLevelUp(address _user) internal {
        uint256 currentLevel = userLevel[_user];
        uint256 newLevel = userPoints[_user] / POINTS_PER_LEVEL;

        if (newLevel > currentLevel) {
            userLevel[_user] = newLevel;
            emit LevelUp(_user, newLevel);
        }
    }

    function _updateLeaderboard(address _user) internal {
        uint256 userScore = userPoints[_user];

        for (uint256 i = 0; i < leaderboard.length; i++) {
            if (leaderboard[i].user == _user) {
                leaderboard[i].score = userScore;
                leaderboard[i].timestamp = block.timestamp;
                _sortLeaderboard();
                return;
            }
        }

        if (leaderboard.length < 100) {
            leaderboard.push(LeaderboardEntry({
                user: _user,
                score: userScore,
                timestamp: block.timestamp
            }));
            _sortLeaderboard();
        } else if (userScore > leaderboard[leaderboard.length - 1].score) {
            leaderboard[leaderboard.length - 1] = LeaderboardEntry({
                user: _user,
                score: userScore,
                timestamp: block.timestamp
            });
            _sortLeaderboard();
        }
    }

    function _sortLeaderboard() internal {
        for (uint256 i = 0; i < leaderboard.length - 1; i++) {
            for (uint256 j = 0; j < leaderboard.length - i - 1; j++) {
                if (leaderboard[j].score < leaderboard[j + 1].score) {
                    LeaderboardEntry memory temp = leaderboard[j];
                    leaderboard[j] = leaderboard[j + 1];
                    leaderboard[j + 1] = temp;
                }
            }
        }
    }

    function activateSocialBonus(address _user) external onlyOwner {
        socialBonus[_user] = true;
        emit SocialBonusActivated(_user);
    }

    function getUserMissions(address _user) external view returns (UserMission[] memory) {
        UserMission[] memory userMissionList = new UserMission[](missionCounter);
        for (uint256 i = 1; i <= missionCounter; i++) {
            userMissionList[i - 1] = userMissions[_user][i];
        }
        return userMissionList;
    }

    function getActiveMissions() external view returns (Mission[] memory) {
        uint256 activeCount = 0;
        for (uint256 i = 1; i <= missionCounter; i++) {
            if (missions[i].active) activeCount++;
        }

        Mission[] memory activeMissions = new Mission[](activeCount);
        uint256 index = 0;
        for (uint256 i = 1; i <= missionCounter; i++) {
            if (missions[i].active) {
                activeMissions[index] = missions[i];
                index++;
            }
        }
        return activeMissions;
    }

    function getLeaderboard() external view returns (LeaderboardEntry[] memory) {
        return leaderboard;
    }

    function getUserStats(address _user) external view returns (
        uint256 points,
        uint256 level,
        uint256 streak,
        bool hasSocialBonus
    ) {
        return (
            userPoints[_user],
            userLevel[_user],
            dailyStreak[_user],
            socialBonus[_user]
        );
    }

    function updateMissionStatus(uint256 _missionId, bool _active) external onlyOwner {
        require(_missionId > 0 && _missionId <= missionCounter, "Invalid mission ID");
        missions[_missionId].active = _active;
    }

    function withdrawRewards(uint256 _amount) external onlyOwner {
        rewardToken.transfer(owner(), _amount);
    }
}

contracts/YieldOptimizer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

contract YieldOptimizer is Ownable, ReentrancyGuard, Pausable {
    using SafeERC20 for IERC20;

    struct YieldStrategy {
        uint256 id;
        string name;
        address strategy;
        uint256 apy;
        uint256 riskLevel;
        uint256 minDeposit;
        uint256 maxDeposit;
        bool active;
    }

    struct UserDeposit {
        uint256 amount;
        uint256 strategyId;
        uint256 depositTime;
        uint256 lastRewardTime;
        uint256 accumulatedRewards;
    }

    struct AIRecommendation {
        uint256 strategyId;
        uint256 confidence;
        uint256 timestamp;
        string reason;
    }

    IERC20 public immutable USDT;

    mapping(uint256 => YieldStrategy) public strategies;
    mapping(address => UserDeposit[]) public userDeposits;
    mapping(address => AIRecommendation) public aiRecommendations;
    mapping(address => uint256) public userRiskTolerance;
    mapping(address => uint256) public userReputationScore;

    uint256 public strategyCounter;
    uint256 public totalValueLocked;
    uint256 public constant MAX_STRATEGIES = 10;
    uint256 public constant MIN_RISK_LEVEL = 1;
    uint256 public constant MAX_RISK_LEVEL = 10;

    event StrategyAdded(uint256 indexed strategyId, string name, uint256 apy);
    event DepositMade(address indexed user, uint256 amount, uint256 strategyId);
    event WithdrawalMade(address indexed user, uint256 amount, uint256 strategyId);
    event RewardsDistributed(address indexed user, uint256 amount);
    event AIRecommendationUpdated(address indexed user, uint256 strategyId, uint256 confidence);
    event RiskToleranceUpdated(address indexed user, uint256 riskLevel);

    modifier validStrategy(uint256 _strategyId) {
        require(_strategyId > 0 && _strategyId <= strategyCounter, "Invalid strategy ID");
        require(strategies[_strategyId].active, "Strategy not active");
        _;
    }

    modifier validRiskLevel(uint256 _riskLevel) {
        require(_riskLevel >= MIN_RISK_LEVEL && _riskLevel <= MAX_RISK_LEVEL, "Invalid risk level");
        _;
    }

    constructor(address _usdt) Ownable(msg.sender) {
        USDT = IERC20(_usdt);
    }

    function addStrategy(
        string memory _name,
        address _strategy,
        uint256 _apy,
        uint256 _riskLevel,
        uint256 _minDeposit,
        uint256 _maxDeposit
    ) external onlyOwner validRiskLevel(_riskLevel) {
        require(strategyCounter < MAX_STRATEGIES, "Max strategies reached");
        require(_strategy != address(0), "Invalid strategy address");
        require(_apy > 0, "APY must be greater than 0");
        require(_minDeposit > 0, "Min deposit must be greater than 0");
        require(_maxDeposit > _minDeposit, "Max deposit must be greater than min");

        strategyCounter++;
        strategies[strategyCounter] = YieldStrategy({
            id: strategyCounter,
            name: _name,
            strategy: _strategy,
            apy: _apy,
            riskLevel: _riskLevel,
            minDeposit: _minDeposit,
            maxDeposit: _maxDeposit,
            active: true
        });

        emit StrategyAdded(strategyCounter, _name, _apy);
    }

    function deposit(uint256 _amount, uint256 _strategyId) 
        external 
        nonReentrant 
        whenNotPaused 
        validStrategy(_strategyId) 
    {
        require(_amount > 0, "Amount must be greater than 0");
        YieldStrategy memory strategy = strategies[_strategyId];
        require(_amount >= strategy.minDeposit, "Amount below minimum deposit");
        require(_amount <= strategy.maxDeposit, "Amount exceeds maximum deposit");

        uint256 userRisk = userRiskTolerance[msg.sender];
        if (userRisk > 0) {
            require(strategy.riskLevel <= userRisk, "Strategy exceeds user risk tolerance");
        }

        USDT.safeTransferFrom(msg.sender, address(this), _amount);

        userDeposits[msg.sender].push(UserDeposit({
            amount: _amount,
            strategyId: _strategyId,
            depositTime: block.timestamp,
            lastRewardTime: block.timestamp,
            accumulatedRewards: 0
        }));

        totalValueLocked += _amount;
        userReputationScore[msg.sender] += 1;

        emit DepositMade(msg.sender, _amount, _strategyId);
    }

    function withdraw(uint256 _depositIndex) external nonReentrant {
        require(_depositIndex < userDeposits[msg.sender].length, "Invalid deposit index");

        UserDeposit storage userDeposit = userDeposits[msg.sender][_depositIndex];
        require(userDeposit.amount > 0, "Deposit already withdrawn");

        uint256 rewards = calculateRewards(msg.sender, _depositIndex);
        uint256 totalAmount = userDeposit.amount + rewards;

        totalValueLocked -= userDeposit.amount;
        userDeposit.amount = 0;
        userDeposit.accumulatedRewards += rewards;

        USDT.safeTransfer(msg.sender, totalAmount);

        emit WithdrawalMade(msg.sender, totalAmount, userDeposit.strategyId);
        if (rewards > 0) {
            emit RewardsDistributed(msg.sender, rewards);
        }
    }

    function calculateRewards(address _user, uint256 _depositIndex) public view returns (uint256) {
        UserDeposit memory userDeposit = userDeposits[_user][_depositIndex];
        if (userDeposit.amount == 0) return 0;

        YieldStrategy memory strategy = strategies[userDeposit.strategyId];
        uint256 timeElapsed = block.timestamp - userDeposit.lastRewardTime;
        uint256 annualReward = (userDeposit.amount * strategy.apy) / 10000;
        uint256 reward = (annualReward * timeElapsed) / 365 days;

        return reward;
    }

    function setUserRiskTolerance(uint256 _riskLevel) external validRiskLevel(_riskLevel) {
        userRiskTolerance[msg.sender] = _riskLevel;
        emit RiskToleranceUpdated(msg.sender, _riskLevel);
    }

    function updateAIRecommendation(
        address _user,
        uint256 _strategyId,
        uint256 _confidence,
        string memory _reason
    ) external onlyOwner validStrategy(_strategyId) {
        require(_confidence <= 100, "Confidence must be <= 100");

        aiRecommendations[_user] = AIRecommendation({
            strategyId: _strategyId,
            confidence: _confidence,
            timestamp: block.timestamp,
            reason: _reason
        });

        emit AIRecommendationUpdated(_user, _strategyId, _confidence);
    }

    function getOptimalStrategy(address _user) external view returns (uint256, uint256) {
        AIRecommendation memory recommendation = aiRecommendations[_user];
        if (recommendation.strategyId > 0 && recommendation.confidence >= 70) {
            return (recommendation.strategyId, recommendation.confidence);
        }

        uint256 userRisk = userRiskTolerance[_user];
        if (userRisk == 0) userRisk = 5;

        uint256 bestStrategy = 0;
        uint256 bestScore = 0;

        for (uint256 i = 1; i <= strategyCounter; i++) {
            YieldStrategy memory strategy = strategies[i];
            if (!strategy.active || strategy.riskLevel > userRisk) continue;

            uint256 score = (strategy.apy * 100) / strategy.riskLevel;
            if (score > bestScore) {
                bestScore = score;
                bestStrategy = i;
            }
        }

        return (bestStrategy, bestScore);
    }

    function getUserDeposits(address _user) external view returns (UserDeposit[] memory) {
        return userDeposits[_user];
    }

    function getStrategy(uint256 _strategyId) external view returns (YieldStrategy memory) {
        return strategies[_strategyId];
    }

    function getAllStrategies() external view returns (YieldStrategy[] memory) {
        YieldStrategy[] memory allStrategies = new YieldStrategy[](strategyCounter);
        for (uint256 i = 1; i <= strategyCounter; i++) {
            allStrategies[i - 1] = strategies[i];
        }
        return allStrategies;
    }

    function updateStrategyStatus(uint256 _strategyId, bool _active) external onlyOwner {
        require(_strategyId > 0 && _strategyId <= strategyCounter, "Invalid strategy ID");
        strategies[_strategyId].active = _active;
    }

    function emergencyWithdraw() external onlyOwner {
        uint256 balance = USDT.balanceOf(address(this));
        USDT.safeTransfer(owner(), balance);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}

